  [],\n\t\"revision_timestamp\": \"2015-05-07T02:06:41.276773\",\n\t\"name\": \"misr-radiometric-camera-by-camera-cloud-mask-v004\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This file contains the Radiometric camera-by-camera
  Cloud Mask dataset. It is used to determine whether a scene is classified as clear
  or cloudy. A new parameter has been added to indicate dust over ocean. This version
  of the ESDT is used by MISR PGE 13. (Suggested Usage: The RCCM is used during geophysical
  parameter retrievals. In the TOA/Cloud Product,RCCM is combined with stereoscopically
  derived cloud mask to 1) establish values of the Reflecting Level Reference Altitude,2)
  determine how a scene is classified for choosing angular integration coefficients
  for establishing TOA albedos,and 3) calculate regional scene classifiers. Retrieval
  of Aerosol/Surface Product properties requires the abscence of clouds,for retrieval
  assumptions to be valid.)\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
